script: |
  super -f text -I q8633.spq | sort > q8633.out

inputs:
  - name: q8633.spq
    data: |
      SELECT DISTINCT ( + col0 ) * - ( 13 * 12 ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( col2 ) BETWEEN col0 AND 6;
  - name: tab0

outputs:
  - name: q8633.out
    data: |
      -13572
      -15132
      -2340
